        @import url('https://fonts.googleapis.com/css?family=Exo:400,700');


button {
    /* 文字サイズを1.4emに指定 */
    font-size: 1.4em;

    /* 文字の太さをboldに指定 */
    font-weight: bold;

    /* 縦方向に10px、
     * 横方向に30pxの余白を指定 */
    padding: 10px 30px;

    /* 背景色を濃い青色に指定 */
    background-color: #248;

    /* 文字色を白色に指定 */
    color: #fff;

    /* ボーダーをなくす */
    border-style: none;
}

button:hover {
    /* 背景色を明るい青色に指定 */
    background-color: #24d;

    /* 文字色を白色に指定 */
    color: #fff;
}

*{
    margin: 0px;
    padding: 0px;
}

body{
    font-family: 'Exo', sans-serif;
}


.context {
    width: 100%;
    position: absolute;
    top:10vh;
    text-align: center;
}

.context h1{
    text-align: center;
    color: #fff;
    font-size: 50px;
}

.context h2{
    text-align: center;
    font-size: 30px;
}

.context iframe{
    text-align: center;
}

.context a{
    background-color: #248;
    text-align: center;
    font-size: 30px;
    color:#fff
}

.context a:hover{
    background-color: #24d;
    color: #fff;
}

.area{
    pointer-events: none;

    background: -webkit-linear-gradient(to left, #8f94fb, #4e54c8);

    height:250vh;

.circles{
    pointer-events: none;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    overflow: hidden;
}

.circles li{
    position: absolute;

    background: rgba(255, 255, 255, 0.2);
    animation: animate 25s linear infinite;

}

    animation-delay: 0s;
}
